import React from 'react'
import './About.css';

function About() {
    return (
        <div class="test">
            <p>
                Hello! My name is Jacob Hawkins! I am a computer science major at the University of Tennessee. I am apart of the Grand Cooke Engineering Honors Program and will soon be working with
                the
                upcoming web development club here at UT.</p>
        </div>
    )
}

export default About
